import React from 'react'

//child CLASSES
class StateObject extends  React.Component 
{

  constructor() 
  {
    super();

    //Create state object and Initialization also
    this.state={
                  id:1,
                  name:'kumar',
                  email:'kumar@gmail.com'
               }
  }

  render() 
  {
      return(<>  

               <div class="container py-5">
                    <h3 className="text-center py-3">CLASS_COMPONENT_with_STATE_OBJECT</h3>

                    <p>
                      U_ID is: { this.state.id }    <br />  

                      but
                      
                      </p>
                    
                    <p>U_NAME is: { this.state.name } </p>
                    
                    <p>U_EMAIL is: { this.state.email } </p>

                
               </div>
            </>)
  }

}

export default StateObject
